import React from 'react';
import ReactDOM from 'react-dom';

let options = [['Date:', 'Time:', 'Priority:', 'Title:', 'Description:', 'Category:'],['10', '10', '10', '10', '10', '10',],[]]
let style;
export default class TaskCreate extends React.Component{
    render(){
        return(
            <div className='taskCreateWindow'>
                <body className='taskCreateTitle'>
                    Create Task
                </body>
                {
                    options[0].map(option => 
                        <body className='taskCreateTxt'>
                            {option}
                        </body>
                    )
                }
                {
                    options[0].map(option, i =>
                        <input type='text'></input>
                    )
                }
            </div>
        );
    }
}
